import React , { Component } from 'react';
import ReactBootstrap, {Nav, Button, Navbar,NavDropdown} from 'react-bootstrap';
import './OrderMngNav.css';
import 'bootstrap/dist/css/bootstrap.min.css';

class OrderMngNav extends Component{
	render(){
		return(
			
<div class="centered-container">
  <div class="actions">
    <div class="actions-title">Colors</div>
    <div class="actions-content"><a class="btn" href="#"><span>Button</span></a><a class="btn blue" href="#"><span>Button</span></a><a class="btn green" href="#"><span>Button</span></a><a class="btn orange" href="#"><span>Button</span></a><a class="btn red" href="#"><span>Button</span></a></div>
  </div>
  <div class="actions">
    <div class="actions-title">Shapes</div>
    <div class="actions-content"><a class="btn" href="#"><span>Initial</span></a><a class="btn hard" href="#"><span>Hard</span></a><a class="btn rounded" href="#"><span>Rounded</span></a></div>
  </div>
  <div class="actions">
    <div class="actions-title">Fills</div>
    <div class="actions-content"><a class="btn" href="#"><span>Initial</span></a><a class="btn bordered" href="#"><span>Bordered</span></a></div>
  </div>
  <div class="actions">
    <div class="actions-title">Icons</div>
    <div class="actions-content"><a class="btn" href="#"><span>Initial</span></a><a class="btn bordered" href="#"><span class="icon material-icons">face</span><span>Icon</span></a></div>
  </div>
  <div class="actions">
    <div class="actions-title">Shapes</div>
    <div class="actions-content"><a class="btn block" href="#"><span>Initial</span></a><a class="btn block" href="#"><span>Block</span></a></div>
  </div>
</div>
			  
		);
	}
}


export default OrderMngNav;
